// The configration for compilation\n        presets: [\n          ["@babel/preset-env", { useBuiltIns: "usage" }],\n          "@babel/preset-react",\n          "@babel/preset-flow"\n        ],\n        plugins: [\n          "@babel/plugin-proposal-class-properties",\n          "@babel/plugin-proposal-object-rest-spread"\n        ]\n      }\n    }\n  });\n\n  return config;\n};\n```\n\nChange your script in `package.json`:\n\n```diff\n/* package.json */\n\n  "scripts": {\n-   "start": "react-scripts start",\n+   "start": "react-app-rewired start",\n-   "build": "react-scripts build",\n+   "build": "react-app-rewired build",\n-   "test": "react-scripts test --env=jsdom",\n+   "test": "react-app-rewired test --env=jsdom"\n}\n```\n\n### Custom webpack setup\n\nTo install `webpack`, run:\n\n```sh\nyarn add --dev webpack webpack-cli webpack-dev-server\n```\n\nIf you don\'t have a webpack config in your project, copy the following to `webpack.config.js` get started:\n\n```js\nconst path = require(\'path\');\n\nmodule.exports = {\n  mode: \'development\',\n\n  // Path to the entry file, change it according to the path you have\n  entry: path.join(__dirname, \'App.js\'),\n\n  // Path for the output files\n  output: {\n    path: path.join(__dirname, \'dist\'),\n    filename: \'app.bundle.js\',\n  },\n\n  // Enable source map support\n  devtool: \'source-map\',\n\n  // Loaders and resolver config\n  module: {\n    rules: [\n\n    ],\n  },\n  resolve: {\n\n  },\n\n  // Development server config\n  devServer: {\n    contentBase: [path.join(__dirname, \'public\')],\n    historyApiFallback: true,\n  },\n};\n```\n\nAlso create a folder named `public` and add the following file named `index.html`:\n\n```html\n<!doctype html>\n<head>\n  <meta charSet="utf-8" />\n  <meta httpEquiv="X-UA-Compatible" content="IE=edge" />\n\n  <meta name="viewport" content="width=device-width,minimum-scale=1,initial-scale=1" />\n\n  <title>App</title>\n\n  <style>\n    html, body, #root {\n      height: 100%;\n    }\n\n    #root {\n      display: flex;\n      flex-direction: column;\n    }\n  </style>\n</head>\n<body>\n  <div id="root"></div>\n  <script src="app.bundle.js"><\/script>\n</body>\n```\n\nNow we\'re ready to start configuring the project.\n\n## Configure webpack\n\n### 1. Alias `react-native` to `react-native-web`\n\nFirst, we have to tell webpack to use `react-native-web` instead of `react-native`. Add the following alias in your webpack config under `resolve`:\n\n```js\nalias: {\n  \'react-native$\': require.resolve(\'react-native-web\'),\n}\n```\n\n### 2. Configure `babel-loader`\n\nNext, we want to tell `babel-loader` to compile `react-native-paper` and `react-native-vector-icons`. We would also want to disable reading the babel configuration files to prevent any conflicts.\n\nFirst install the required dependencies:\n\n```sh\nyarn add --dev babel-loader @babel/preset-env @babel/preset-react @babel/preset-flow @babel/plugin-proposal-class-properties @babel/plugin-proposal-object-rest-spread\n```\n\nNow, add the following in the `module.rules` array in your webpack config:\n\n```js\n{\n  test: /\\.js$/,\n  exclude: /node_modules[/\\\\](?!react-native-paper|react-native-vector-icons|react-native-safe-area-view)/,\n  use: {\n    loader: \'babel-loader\',\n    options: {\n      // Disable reading babel configuration\n      babelrc: false,\n      configFile: false,\n\n      // The configration for compilation\n      presets: [\n        [\'@babel/preset-env\', { useBuiltIns: \'usage\' }],\n        \'@babel/preset-react\',\n        \'@babel/preset-flow\',\n      ],\n      plugins: [\n        \'@babel/plugin-proposal-class-properties\',\n        \'@babel/plugin-proposal-object-rest-spread\'\n      ],\n    },\n  },\n},\n```\n\n### 3. Configure `file-loader`\n\nTo be able to import images and other assets using `require`, we need to configure `file-loader`. Let\'s install it:\n\n```sh\nyarn add --dev file-loader\n```\n\nTo configure it, add the following in the `module.rules` array in your webpack config:\n\n```js\n{\n  test: /\\.(jpg|png|woff|woff2|eot|ttf|svg)$/,\n  loader: \'file-loader\',\n}\n```\n\n## Load the Material icons\n\nIf you followed the getting started guide, you should have the following code in your root component:\n\n```js\n<PaperProvider>\n  <App />\n</PaperProvider>\n```\n\nNow we need tweak this section to load the Material icons from the [`react-native-vector-icons`](https://github.com/oblador/react-native-vector-icons) library:\n\n```js\n<PaperProvider>\n  <React.Fragment>\n    {Platform.OS === \'web\' ? (\n      <style type="text/css">{`\n        @font-face {\n          font-family: \'MaterialIcons\';\n          src: url(${require(\'react-native-vector-icons/Fonts/MaterialIcons.ttf\')}) format(\'truetype\');\n        }\n      `}</style>\n    ) : null}\n    <App />\n  </React.Fragment>\n</PaperProvider>\n```\n\nRemember to import `Platform` from `react-native` at the top:\n\n```js\nimport { Platform } from \'react-native\';\n```\n\nYou can also load these fonts using [`css-loader`](https://github.com/webpack-contrib/css-loader) if you prefer.\n\n## Load the Roboto fonts (optional)\n\nThe default theme in React Native Paper uses the Roboto font. You can add them to your project following [the instructions on its Google Fonts page](https://fonts.google.com/specimen/Roboto?selection.family=Roboto:100,300,400,500).\n\n## We\'re done!\n\nYou can run `webpack-dev-server` to run the webpack server and open your project in the browser. You can add the following script in your `package.json` under the `"scripts"` section to make it easier:\n\n```json\n"web": "webpack-dev-server --open"\n```\n\nNow you can run `yarn web` to run the project on web.\n',type:"md",dependencies:[]},function(){var e=n("./pages/5.showcase.js"),t="function"==typeof e.default?e.default:e,r=e.meta||{};return{title:r.title||"Showcase",link:r.link||"showcase",description:r.description,type:"custom",data:t}}(),{filepath:"pages/6.recommended-libraries.md",title:"Recommended Libraries",description:"",link:"recommended-libraries",data:"# Recommended Libraries\n\nOur mission is to provide a full suite of well-integrated components built with Material Design in mind. However, many components already have better well maintained implementations.\n\nHere are some of the libraries we recommend:\n\n## Tabs\n\n[react-native-community/react-native-tab-view](https://github.com/react-native-community/react-native-tab-view)\n\nMaterial Design themed [swipeable tabs](https://material.io/design/components/tabs.html), maintained by [@satya164](https://twitter.com/satya164) and [@mosdnk](https://twitter.com/mosdnk).\n\n## Bottom sheet\n\n[osdnk/reanimated-bottom-sheet](https://github.com/osdnk/react-native-reanimated-bottom-sheet)\n\nAn implementation [bottom sheet behaviour](https://material.io/design/components/sheets-bottom.html), maintained by [@mosdnk](https://twitter.com/mosdnk).\n",type:"md",dependencies:[]},{filepath:"pages/7.contributing.md",title:"Contributing",description:"",link:"contributing",data:"# Contributing to React Native Paper\n\n## Code of Conduct\n\nWe want this community to be friendly and respectful to each other. Please read [the full text](/CODE_OF_CONDUCT.md) so that you can understand what actions will and will not be tolerated.\n\n## Our Development Process\n\nThe core team works directly on GitHub and all work is public.\n\n### Development workflow\n\n> **Working on your first pull request?** You can learn how from this *free* series: [How to Contribute to an Open Source Project on GitHub](https://egghead.io/series/how-to-contribute-to-an-open-source-project-on-github).\n\n1. Fork the repo and create your branch from `master` (a guide on [how to fork a repository](https://help.github.com/articles/fork-a-repo/)).\n2. Run `yarn bootstrap` to setup the development environment.\n3. Do the changes you want and test them out in the example app before sending a pull request.\n\n### Commit message convention\n\nWe follow the [conventional commits specification](https://www.conventionalcommits.org/en) for our commit messages:\n\n* `fix`: bug fixes, e.g. fix Button color on DarkTheme.\n* `feat`: new features, e.g. add Snackbar component.\n* `refactor`: code refactor, e.g. new folder structure for components.\n* `docs`: changes into documentation, e.g. add usage example for Button.\n* `test`: adding or updating tests, eg unit, snapshot testing.\n* `chore`: tooling changes, e.g. change circleci config.\n* `BREAKING CHANGE`: for changes that break existing usage, e.g. change API of a component.\n\nOur pre-commit hooks verify that your commit message matches this format when committing.\n\n### Linting and tests\n\nWe use `flow` for type checking, `eslint` with `prettier` for linting and formatting the code, and `jest` for testing. Our pre-commit hooks verify that the linter and tests pass when commiting. You can also run the following commands manually:\n\n* `yarn flow`: run flow on all files.\n* `yarn typescript`: run tests for typescript definitions.\n* `yarn lint`: lint files with eslint and prettier.\n* `yarn test`: run unit tests with jest.\n\n### Sending a pull request\n\nWhen you're sending a pull request:\n\n* Prefer small pull requests focused on one change.\n* Verify that `flow`, `eslint` and all tests are passing.\n* Preview the documentation to make sure it looks good.\n* Follow the pull request template when opening a pull request.\n\nWhen you're working on a component:\n\n* Follow the guidelines described in the [official material design docs](https://material.io/guidelines/).\n* Write a brief description of every prop when defining `type Props` to aid with documentation.\n* Provide an example usage for the component (check other components to get a idea).\n* Update the type definitions for Flow and Typescript if you changed an API or added a component.\n\n### Running the example\n\nThe example app uses [Expo](https://expo.io/) for the React Native example. You will need to install the Expo app for [Android](https://play.google.com/store/apps/details?id=host.exp.exponent) and [iOS](https://itunes.apple.com/app/apple-store/id982107779) to start developing.\n\nAfter you're done, you can run `yarn example start` in the project root (or `expo start` in the `example/` folder) and scan the QR code to launch it on your device.\n\nTo run the example on web, run `yarn example web` in the project root.\n\n### Working on documentation\n\nThe documentation is automatically generated from the [flowtype](https://flowtype.org) annotations in the components. You can add comments above the type annotations to add descriptions. To preview the generated documentation, run `yarn docs start` in the project root.\n\n### Publishing a release\n\nWe use [release-it](https://github.com/webpro/release-it) to automate our release. If you have publish access to the NPM package, run the following from the master branch to publish a new release:\n\n```sh\nyarn release\n```\n\nNOTE: You must have a `GITHUB_TOKEN` environment variable available. You can create a GitHub access token with the \"repo\" access [here](https://github.com/settings/tokens).\n\n## Reporting issues\n\nYou can report issues on our [bug tracker](https://github.com/callstack/react-native-paper/issues). Please follow the issue template when opening an issue.\n\n## License\n\nBy contributing to React Native Paper, you agree that your contributions will be licensed under its **MIT** license.\n\n",type:"md",dependencies:["/home/circleci/react-native-paper/CONTRIBUTING.md"]},{type:"separator"},{filepath:"../src/components/ActivityIndicator.tsx",title:"ActivityIndicator",description:'Activity indicator is used to present progress of some activity in the app.\nIt can be used as a drop-in for the ActivityIndicator shipped with React Native.\n\n<div class="screenshots">\n  <img src="screenshots/activity-indicator.gif" style="width: 100px;" />\n</div>\n\n## Usage\n```js\nimport * as React from \'react\';\nimport { ActivityIndicator, Colors } from \'react-native-paper\';\n\nconst MyComponent = () => (\n  <ActivityIndicator animating={true} color={Colors.red800} />\n);\n\nexport default MyComponent;\n```',link:"activity-indicator",data:{description:'Activity indicator is used to present progress of some activity in the app.\nIt can be used as a drop-in for the ActivityIndicator shipped with React Native.\n\n<div class="screenshots">\n  <img src="screenshots/activity-indicator.gif" style="width: 100px;" />\n</div>\n\n## Usage\n```js\nimport * as React from \'react\';\nimport { ActivityIndicator, Colors } from \'react-native-paper\';\n\nconst MyComponent = () => (\n  <ActivityIndicator animating={true} color={Colors.red800} />\n);\n\nexport default MyComponent;\n```',displayName:"ActivityIndicator",methods:[{name:"_startRotation",docblock:null,modifiers:[],params:[],returns:null},{name:"_stopRotation",docblock:null,modifiers:[],params:[],returns:null}],statics:[],props:{animating:{required:!1,tsType:{name:"boolean"},description:"Whether to show the indicator or hide it.",defaultValue:{value:"true",computed:!1}},color:{required:!1,tsType:{name:"string"},description:"The color of the spinner."},size:{required:!1,tsType:{name:"union",raw:"'small' | 'large' | number",elements:[{name:"literal",value:"'small'"},{name:"literal",value:"'large'"},{name:"number"}]},description:"Size of the indicator.",defaultValue:{value:"'small'",computed:!1}},hidesWhenStopped:{required:!1,tsType:{name:"boolean"},description:"Whether the indicator should hide when not animating.",defaultValue:{value:"true",computed:!1}},style:{required:!1,tsType:{name:"StyleProp",elements:[{name:"ViewStyle"}],raw:"StyleProp<ViewStyle>"},description:""},theme:{required:!0,tsType:{name:"Theme"},description:"@optional"}}},type:"component",dependencies:["/home/circleci/react-native-paper/src/components/ActivityIndicator.tsx"]},{filepath:"../src/components/Appbar/Appbar.tsx",title:"Appbar",description:"A component to display action items in a bar. It can be placed at the top or bottom.\nThe top bar usually contains the screen title, controls such as navigation buttons, menu button etc.\nThe bottom bar usually provides access to a drawer and up to four actions.\n\n<div class=\"screenshots\">\n  <img class=\"medium\" src=\"screenshots/appbar.png\" />\n</div>\n\n## Usage\n```js\nimport * as React from 'react';\nimport { Appbar } from 'react-native-paper';\nimport { StyleSheet } from 'react-native';\n\nexport default class MyComponent extends React.Component {\n  render() {\n    return (\n      <Appbar style={styles.bottom}>\n        <Appbar.Action icon=\"archive\" onPress={() => console.log('Pressed archive')} />\n        <Appbar.Action icon=\"mail\" onPress={() => console.log('Pressed mail')} />\n        <Appbar.Action icon=\"label\" onPress={() => console.log('Pressed label')} />\n        <Appbar.Action icon=\"delete\" onPress={() => console.log('Pressed delete')} />\n      </Appbar>\n    );\n  }\n}\n\nconst styles = StyleSheet.create({\n  bottom: {\n    position: 'absolute',\n    left: 0,\n    right: 0,\n    bottom: 0,\n  },\n});\n```",link:"appbar",data:{description:"A component to display action items in a bar. It can be placed at the top or bottom.\nThe top bar usually contains the screen title, controls such as navigation buttons, menu button etc.\nThe bottom bar usually provides access to a drawer and up to four actions.\n\n<div class=\"screenshots\">\n  <img class=\"medium\" src=\"screenshots/appbar.png\" />\n</div>\n\n## Usage\n```js\nimport * as React from 'react';\nimport { Appbar } from 'react-native-paper';\nimport { StyleSheet } from 'react-native';\n\nexport default class MyComponent extends React.Component {\n  render() {\n    return (\n      <Appbar style={styles.bottom}>\n        <Appbar.Action icon=\"archive\" onPress={() => console.log('Pressed archive')} />\n        <Appbar.Action icon=\"mail\" onPress={() => console.log('Pressed mail')} />\n        <Appbar.Action icon=\"label\" onPress={() => console.log('Pressed label')} />\n        <Appbar.Action icon=\"delete\" onPress={() => console.log('Pressed delete')} />\n      </Appbar>\n    );\n  }\n}\n\nconst styles = StyleSheet.create({\n  bottom: {\n    position: 'absolute',\n    left: 0,\n    right: 0,\n    bottom: 0,\n  },\n});\n```",displayName:"Appbar",methods:[],statics:[{name:"Content",description:null,docblock:null,type:null},{name:"Action",description:null,docblock:null,type:null},{name:"BackAction",description:null,docblock:null,type:null},{name:"Header",description:null,docblock:null,type:null}],props:{dark:{required:!1,tsType:{name:"boolean"},description:"Whether the background color is a dark color. A dark appbar will render light text and vice-versa."},children:{required:!0,tsType:{name:"ReactReactNode",raw:"React.ReactNode"},description:"Content of the `Appbar`."},theme:{required:!0,tsType:{name:"Theme"},description:"@optional"},style:{required:!1,tsType:{name:"StyleProp",elements:[{name:"ViewStyle"}],raw:"StyleProp<ViewStyle>"},description:""}}},type:"component",dependencies:["/home/circleci/react-native-paper/src/components/Appbar/Appbar.tsx"]},{filepath:"../src/components/Appbar/AppbarAction.tsx",title:"Appbar.Action",description:"A component used to display an action item in the appbar.",link:"appbar-action",data:{description:"A component used to display an action item in the appbar.",displayName:"Appbar.Action",methods:[],statics:[],props:{color:{required:!1,tsType:{name:"string"},description:"Custom color for action icon."},icon:{required:!0,tsType:{name:"IconSource"},description:"Name of the icon to show."},size:{required:!1,tsType:{name:"number"},description:"Optional icon size.",defaultValue:{value:"24",computed:!1}},disabled:{required:!1,tsType:{name:"boolean"},description:"Whether the button is disabled. A disabled button is greyed out and `onPress` is not called on touch."},accessibilityLabel:{required:!1,tsType:{name: